import React from 'react';
import css from './MyPosts.module.css'
import Post from './Post/Post';
import NewPost from './NewPost/NewPost';

const MyPosts = () => {
    return (


        <div className={css.posts}>
          <h2>My Posts</h2>
          <NewPost />
          <ul className={css.posts__list}>
            <Post message="Первый пост через пропсы"
                  imgUrl="https://scontent-hel2-1.cdninstagram.com/v/t51.2885-19/s150x150/83175097_608160346627556_1983433867435966464_n.jpg?_nc_ht=scontent-hel2-1.cdninstagram.com&_nc_ohc=I6kC_JJCgZIAX_qJjLq&oh=732502044e9338ee2b5b63e7f40b23d4&oe=5EB726D1"
            />
            <Post  message="Скоро я буду реакт разработчиком!"
            />
            <Post  message="Дуров, верни стену!!"
            />
          </ul>
        </div>
    )
}

export default MyPosts;
